var $ = require('jquery');
var _ = require('underscore');
var Whammy = require('../../util/Whammy.js');
var html2canvas = require('html2canvas');
var oCanvas = require('ocanvas');

$(function(){
	var _video = null;
	var _canvas = oCanvas.create({
		canvas: '#top'
	});

	var title = _canvas.display.text({
		x: 10, y: 10,
		origin: { x: 'left', y: 'top' },
		font: 'bold 30px sans-serif',
		text: 'Today Snap Video',
		fill: '#0aa'
	});

	var description = _canvas.display.text({
		x: 10, y: 50,
		origin: { x: 'left', y: 'top' },
		font: '10px sans-serif',
		text: 'https://www.pikicast.com',
		fill: '#0aa'
	});

	var image = _canvas.display.image({
		x: 100,
		y: 100,
		image: '/image/500_24086387_1463743577.gif'// 'data:image/webp;base64,'
	});

	_canvas.addChild(image);
	_canvas.addChild(title);
	_canvas.addChild(description);

	var _interval = {
		id: null,
		sec: 20,
		max: (1000 / 20) * 3
	};

	var render = function(){console.log('render', _canvas, _canvas.canvasElement.getContext('2d'));
		if(!!_interval.id) window.clearInterval(_interval.id);

		_video = new Whammy.Video(36, 1);

		var video = $('video#origin');

		video.bind({
			'ended': _.bind(function(event){
				stop();
			}, this)
		});

		video[0].play(); console.log( _canvas.canvas.canvas.getContext('2d'));

		_interval.id = window.setInterval(_.bind(function(){
			var ctx = $('canvas#bottom')[0].getContext('2d');

			ctx.drawImage(video[0], 0, 0, $(video).width(), $(video).height());

			//html2canvas($('div.container.origin'), {
			//	onrendered: function(canvas){
			//		_video.add(canvas.getContext('2d'));
			//	},
			//	width: 360,
			//	height: 600
			//});

			_video.add(ctx);

		}, this), _interval.sec);
	};

	var stop = function(){

		$('video#origin')[0].pause();

		window.clearInterval(_interval.id);
		$('video#output').attr('src', window.URL.createObjectURL(_video.compile()));

		console.log(_video);
	};

	$('a#render').bind({
		'click': _.bind(render, this)
	});

	$('a#stop').bind({
		'click': _.bind(stop, this)
	});

	$('a#replace').bind({
		'click': function(event){
			//var url =  _video.frames[0].image; //console.log(url);


			image.image = '/image/500_24086387_1463743577.gif'; //url; //_canvas.draw.redraw();

			//_canvas.background.set(url);

			_canvas.redraw();
		}
	});
});